#!/usr/bin/env python
# coding: utf-8

# In[1]:


import numpy as np
import pandas as pd
import glob
import os.path
import datetime
import os


# In[2]:


get_ipython().system('pip install tabulate')


# In[3]:


# row 생략 없이 출력
pd.set_option('display.max_rows', None)
# col 생략 없이 출력
pd.set_option('display.max_columns', None)


# In[4]:


df = pd.read_csv('5min_seq_0224.csv')


# In[5]:


print(df)


# In[6]:


group = df.groupby(by=['user_id'], as_index=False).count()[['user_id','sequence']]
print(group)


# In[7]:


mean_df = group['sequence'].mean()
print('사용자별 평균 시퀀스 개수: ', mean_df)


# In[8]:


max_df = group['sequence'].max()
condition = (group.sequence == max_df) # 조건식
print(group[condition])
#print('최대 시퀀스 개수: ', max_df)
#print('해당 user id: ', mean_df['sequence' == max_df])


# In[9]:


min_df = group['sequence'].min()
condition = (group.sequence == min_df) # 조건식
print(group[condition])


# In[10]:


print(df.groupby(df['user_id']).mean())


# In[11]:


# visited places per sequence
cnt = 0
df['places'] = 'a'
for i in df['sequence']:
    temp_list = []
    j = 0
    while j < len(i):
        if i[j] == '-':
            j = j + 1
        else:
            temp_list.append(i[j:j+6])
            j = j + 6
    trimmed = []
    for value in temp_list: 
        if value not in trimmed: 
            trimmed.append(value)
    # print(trimmed)
    df['places'].iloc[cnt] = trimmed
    cnt = cnt + 1
    
# sequence -> list
cnt = 0
df['seq_list'] = 'a'
for i in df['sequence']:
    temp_list = []
    j = 0
    while j < len(i):
        if i[j] == '-':
            j = j + 1
        else:
            temp_list.append(i[j:j+6])
            j = j + 6
    # print(trimmed)
    df['seq_list'].iloc[cnt] = temp_list
    cnt = cnt + 1
    
# sequence trimming


# In[12]:


df['user_duration_mean'] = df.groupby(['user_id'])['min'].transform('mean')
df['user_duration_std'] = df.groupby(['user_id'])['min'].transform('std')
df['diff_mean'] = df['min'] - df['user_duration_mean']


# In[13]:


df.to_csv('5min_seq_mean.csv', index=False)


